import React from "react";
import { useNavigate } from "react-router-dom";
import './UploadAndDiagnosis.css';

function UploadAndDiagnosis() {
    const navigate = useNavigate();

    const handleUploadClick = () => {
        navigate('/upload-and-diagnose'); // Navigate to the Api component
    };

    return (
        <div className="maincontainer">
            <div className="container1">
                <h6 className="protect">Protect Your Crop</h6>
                <div id="up">Upload and Diagnose</div>
                <div className="upl">
                    Upload plant images to diagnose diseases and safeguard your crops using our advanced CNN model.
                </div>
            </div>
            <div className='container2'>
                <div className="i col-md-6">
                    <img
                        className="img"
                        src="https://cdn.wegic.ai/assets/onepage/ai/image/1dc4cd5e-92a3-435e-8acf-4df500346f62.jpeg"
                        alt="normalimage"
                    />
                </div>
                <div className="container col-md-6">
                    <div className='row'>
                        <div className='first col-ms-12' id='first'>
